import React from "react";
import Logo from "../components/Logo";
//Appel la Navigation pour faire fonctionner la navigation
import Navigation from "../components/Navigation";

const Parcours = () => {
  return (
    <div>
      <Logo />
      <Navigation />
      <div className="affich2">
        <div className="container">
          <div className="moi">
            <d>
              <b>Mes Formations</b>
            </d>
            <div className="row">
              <div className="col">
                <p style={{ fontWeight: "bold", fontSize: "1" }}>
                  BTS SIO (Services Informatiques au Organisations) SLAM
                  (Développement web et le Développement d’Applications Mobiles)
                  | 2021-2023
                </p>
              </div>
              <div className="col"></div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Parcours;
